import { withNamespaces } from 'react-i18next';

 const Users = (props) => {


          return (
              <React.Fragment>
                <div className="page-content">
                    <Container fluid>

                        {/* Render Breadcrumb */}
                        <Breadcrumbs title={props.t('My Users')} breadcrumbItem={props.t('Users')} />

                        <Row>
                            <Col lg="12">
                                <UsersList />
                            </Col>
                        </Row>
                    </Container>
                </div>
            </React.Fragment>
          );
        }

export default withNamespaces()(Users);
